// Note by Paul Pedriana:
// We use externalDeref here, but an alternative might be to use 
// explicit delete (i.e. directly calling the destructor). However,
// externalDeref seems to do the same thing and is used by the
// QualifiedName::unInit() function itself, so we follow that convention
// for now while it works.

#ifdef AVOID_STATIC_CONSTRUCTORS  // Used by GCC.
    void forceExternalDeref(void* pQualifiedName)
    {
        QualifiedName& obj = *reinterpret_cast<QualifiedName*>(pQualifiedName);
        obj.externalDeref();
    }
#else   // Used by VC++.
    void forceExternalDeref(const QualifiedName& const_obj)
    {
        QualifiedName& obj = const_cast<QualifiedName&>(const_obj);
        obj.externalDeref();
    }
#endif

